import React from "react";
import * as TABLE from "./styles/table.styles";

const Attendance = ({ nonAttenData }) => {
  console.log("nonAttenData", nonAttenData);
  return (
    <React.Fragment>
      <TABLE.TableTypeSection>
        <TABLE.TBHeader>Non-Posted Attendance Dates</TABLE.TBHeader>
      </TABLE.TableTypeSection>
      {/*Table Starte */}
      <TABLE.TableWrapper>
        <TABLE.TableTheader>
          <TABLE.TableTR>
            <TABLE.TableTh>Date</TABLE.TableTh>
            <TABLE.TableTh>Course Name</TABLE.TableTh>
            <TABLE.TableTh>Semester</TABLE.TableTh>
            <TABLE.TableTh>Section</TABLE.TableTh>
            <TABLE.TableTh>Attendance Status</TABLE.TableTh>
          </TABLE.TableTR>
        </TABLE.TableTheader>
        <TABLE.TableTbody>
          <TABLE.TableTR>
            <td>d</td>
            <td>d</td>
            <td>d</td>
            <td>d</td>
            <td>d</td>
          </TABLE.TableTR>
          <TABLE.TableTR>
            {nonAttenData?.dates &&
              nonAttenData.dates.map((date) => (
                <TABLE.TableTd>{date}</TABLE.TableTd>
              ))}
          </TABLE.TableTR>
          <TABLE.TableTR>
            {nonAttenData?.courses &&
              nonAttenData.courses.map((cource) => (
                <TABLE.TableTd>{cource}</TABLE.TableTd>
              ))}
          </TABLE.TableTR>
          <TABLE.TableTR></TABLE.TableTR>
          <TABLE.TableTR></TABLE.TableTR>
          <TABLE.TableTR></TABLE.TableTR>
        </TABLE.TableTbody>
      </TABLE.TableWrapper>
    </React.Fragment>
  );
};

export default Attendance;
